    return math.atan2(touch_vector[1], touch_vector[0])
def grip_rotation(grip, touch_vectors):
    return sum(touch_rotation(touch, touch_vector) for touch_vector in touch_vectors) / len(touch_vectors)
def grip_distance(grip, touch_vectors):
    return sum(touch_distance(touch, grip) for touch_vector in touch_vectors) / len(touch_vectors)
def arc_length(rotation, grip_distance):
    return grip_distance * math.sin(rotation)
def classify(grip1, grip2):
    touch_vectors1 = [touch_vector(touch, grip1) for touch in grip1]
    touch_vectors2 = [touch_vector(touch, grip2) for touch in grip2]
    rotation1 = grip_rotation(grip1, touch_vectors1)
    rotation2 = grip_rotation(grip2, touch_vectors2)
    distance1 = grip_distance(grip1, touch_vectors1)
    distance2 = grip_distance(grip2, touch_vectors2)
    rotation_distance = arc_length(rotation2 - rotation1, grip_distance(grip1, touch_vectors1))
