import math

def is_perfect_power(n):
    if n < 2:
        return True
    for base in range(2, int(math.sqrt(n)) + 1):
        exp = 2
        while base ** exp <= n:
            if base ** exp == n:
                return True
            exp += 1
    return False

def largest_perfect_power(x):
    for i in range(x, 0, -1):
        if is_perfect_power(i):
            return i
    return None

