def is_valid(S, P):
    if S == P:
        return True
    if len(S) == len(P) + 1:
        if S[0] == P[-1]:
            return True
    if len(S) == len(P) - 1:
        if S[-1] == P[0]:
            return True
    if S.swapcase() == P:
        return True
    return False

def max_rainy_days(records):
    max_rainy_days = 0
    current_rainy_days = 0
    for record in records:
        if record == 'R':
            current_rainy_days += 1
            max_rainy_days = max(max_rainy_days, current_rainy_days)
        else:
            current_rainy_days = 0
    return max_rainy_days

